import React from "react";
import About from './Routes/About';
import Home from './Routes/Home';
import {Routes , Route} from "react-router-dom";




const App = () => {
  return (
    <>
    <Routes>
       <Route path="/" Component={About} />
       <Route path="/home" Component={Home} />
    </Routes>
    </>
  );
}

export default App;
